import { apiKey, PLAYLISTSITEMS, YOUTUBEURL } from './apis';

export const playlistItems = async (plistId) => {
  return await fetch(`
        ${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${plistId}&maxResult=10&part=isnippet
    `).then((res) => res.json());
};
